import axios from 'axios';
function Definitivo() {
const [idregion, setIdRegion] = useState (-1);
state ={ objeto:[]
}
componentDidMount= () => {
  axios
  .get("http://127.0.0.1:8000/api/welcome")
  .then((response) =>{
    console.log(response);
    this.setState({objeto: response.data})
})
.catch((error) =>{
  console.log(error);
});
}
return(
<div className="row">
    <div className="col-6">
<h3>Regiones</h3>
<select name="region" id="selRegion">

    {this.state.region.map(elemento=>(

        <option key={elemento.region_id} value={elemento.region_id}>{elemento.nombre_regions}</option>
      ))}
</select>
    
    </div>

</div>
)
}
